import Heading from "./Heading";
import Pera from "./Pera";
import List from "./List";
// import "./index.css";

function App(){
    return(
        <>
    <Heading/>
    <Pera/>
    <List/>
    <Pera/>
    <Pera/>
    </>
    );
    
}

export default App;
